import { StyleSheet } from "react-native";

const experienceScreenStyles = StyleSheet.create({
    title: {
        fontWeight: 'bold',
        fontSize: 36,
        paddingBottom: 15,
    },

    subTitle: {
        fontWeight: "bold",
        fontSize: 13,
    },

    photoGrid: {
        flexDirection: "row",
        padding: 5,
    },

    photoPadding: {
        padding: 10,
    },

    parentScrollView: {
        marginTop: 50,
        marginBottom: 25,
    },

})

export {experienceScreenStyles}
